[DEFAULT]
Model_dir=./data
Model_name=ssd_512_mobilenet1.0_coco
Device_type=
Device_ids=
# default: None(0), DEBUG(10), INFO(20)
# WARNING(30), ERROR(40), CRITICAL(50)
Verbosity=20
Input_shape=(-1, 3, 512, 512)
Start=

[PREPARE]
Dump=True

[SPLIT_MODEL]
# ssd0_multiperclassdecoder0_zeros_like0,
# ssd0_multiperclassdecoder0_slice_axis0,
Keys=
  ssd0_softmax0,
  ssd0_normalizedboxcenterdecoder0_concat0
Dump=True

[CALIBRATION]
Batch=16
Calibrate_num=
Lambda=
Dataset=coco
Device_type=gpu
Device_ids=2
Dump=

[QUANTIZATION]
Input_precision=
Output_precision=30
Device_type=gpu
Device_ids=1
Softmax_lambd=
Shift_bits=
Thresholds=
  data: 2.64,
  ssd0_multiperclassdecoder0_slice_axis0: 1
Restore_name=
Dump=True

[MERGE_MODEL]
Attribute_deps=
  _greater_scalar: scalar: ssd0_softmax0,
  _contrib_box_nms: valid_thresh: ssd0_softmax0
Oscale_maps=
  ssd0_slice_axis161: None,
  ssd0_slice_axis162: ssd0_softmax0,
  ssd0_slice_axis163: ssd0_normalizedboxcenterdecoder0_concat0
Dump=True

[EVALUATION]
Batch=16
Device_type=gpu
Device_ids=2
Iter_num=2

[COMPILATION]
Batch=1
Dump_dir=/data/wlt

